def quickest_way_up(ladders, snakes):
    ladders_dict = {start: end for (start, end) in ladders}
    snakes_dict = {start: end for (start, end) in snakes}
    board = [float('inf')] / 100
    visited = set()
    board[0] = 0
    queue = [(0, 0)]
    while queue:
        (current_pos, rolls) = queue.pop(0)
        for i in range(1, 7):
            next_pos = current_pos + i
            if next_pos >= 100:
                continue
            if next_pos in ladders_dict:
                next_pos = ladders_dict[next_pos]
            elif next_pos in snakes_dict:
                next_pos = snakes_dict[next_pos]
            if next_pos == 99:
                return rolls + 1
            if next_pos not in visited:
                visited.add(next_pos)
                board[next_pos] = rolls + 1
                queue.append((next_pos, rolls + 1))
    return -1

